import './App.css';
import React from 'react';
import CollapsibleTable from './components/CryptoTableList.jsx';
import axios from 'axios';
import styled from 'styled-components';


const Container = styled.div`
display: 'flex',
`

const api = axios.create({baseURL: 'https://api.cryptostats.community/api/v1/fees/'})

function App() {

  const [data, setData] = React.useState([])

  const fetchApi = async () => {
    await api.get('oneDayTotalFees/2022-12-08', null,
    )
    .then((res) => {
        console.log(res.data.data)
        const array = res.data.data
        array.sort((a, b) => {
          return (b.results.oneDayTotalFees - a.results.oneDayTotalFees) 
        })
        console.log(array)
        setData(res.data.data)
    })
    .catch((err) => {
        console.log(err)
    })
}

  React.useEffect(() => {

    fetchApi();
  }, [])


  return (
    <div className="App">
      <header className="App-header">
        Crypto Fees
      </header>
      { data && <CollapsibleTable data={data}/>}

    </div>
  );
}

export default App;
